import Photo from './images/member-photo.png';
import Info from './images/button01.png';
import Salary from './images/button02.png';
import Mission from './images/button03.png';
import './App.css';
import './pages/Home';
import './pages/MemberInfo';
import './pages/ModifyInfo';

function App() {
  return (
    <div className="App">
      <header>
        <div className='member-photo'><img src={Photo} alt="photo" /></div>
        <div className="member-name"><h1>李姍姍</h1><p>上線中</p></div>
      </header>
      <main>
        <div className='announcement'>
          <h2>Home心公告</h2>
          <hr />
          <ul>
            <li>疫情期間，大家要多注意勤洗手，小心健康！</li>
            <li>若您已經施打完疫苗，可以透過小幫手回報給我們唷！</li>
          </ul>
        </div>
        <div className="feature">
          <div className='row'>
            <div className="info">
              <img src={Info} alt="Info" />
              <h3>會員資訊</h3>
            </div>
            <div className="salary">
              <img src={Salary} alt="Salary" />
              <h3>薪水查詢</h3>
            </div>
          </div>
          <div className="mission">
            <img src={Mission} alt="Mission" />
            <h3>平台任務</h3>

          </div>

        </div>

      </main>
      {/* <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>Edit <code>src/App.js</code> and save to reload.</p>
        <a className="App-link" href="https://reactjs.org" target="_blank" rel="noopener noreferrer">Learn React</a>
      </header> */}
    </div>
  );
}

export default App;
